		<video id="myVideo"  playsinline autoplay muted loop>
		<source src="https://www.learningcontainer.com/bfd_download/sample-mp4-file/"
	            type="video/mp4"></source>		</video>



		<h2>
		New Wave
		</h2>
		<h3>Property Group</h3>
			<p class="animated fadeInUp">We take your dream home and make it real.</p>
			<Link to='/contactpage'>
			<button className="button1">BOOK YOUR CONSULTATION</button>
			</Link>

		</div>
	</div>
);
